CREATE TABLE logger_masterylog (id char(32) NOT NULL PRIMARY KEY, _morango_dirty_bit bool NOT NULL, _morango_source_id varchar(96) NOT NULL, 
	_morango_partition varchar(128) NOT NULL, mastery_criterion text NOT NULL, start_timestamp datetime NOT NULL, end_timestamp datetime NULL, 
	completion_timestamp datetime NULL, mastery_level integer NOT NULL, complete bool NOT NULL, dataset_id char(32) NOT NULL REFERENCES kolibriauth_facilitydataset (id),
	 summarylog_id char(32) NOT NULL REFERENCES logger_contentsummarylog (id), user_id char(32) NOT NULL REFERENCES kolibriauth_facilityuser (id));

CREATE TABLE logger_contentsummarylog (id char(32) NOT NULL PRIMARY KEY, _morango_dirty_bit bool NOT NULL, 
	_morango_source_id varchar(96) NOT NULL, _morango_partition varchar(128) NOT NULL, content_id char(32) NOT NULL,
	 channel_id char(32) NOT NULL, start_timestamp datetime NOT NULL, end_timestamp datetime NULL, completion_timestamp datetime NULL, 
	 time_spent real NOT NULL, progress real NOT NULL, kind varchar(200) NOT NULL, extra_fields text NOT NULL, 
	 dataset_id char(32) NOT NULL REFERENCES kolibriauth_facilitydataset (id), user_id char(32) NOT NULL REFERENCES kolibriauth_facilityuser (id));

CREATE TABLE logger_attemptlog (id char(32) NOT NULL PRIMARY KEY, _morango_dirty_bit bool NOT NULL, 
	_morango_source_id varchar(96) NOT NULL, _morango_partition varchar(128) NOT NULL, item varchar(200) NOT NULL, 
	start_timestamp datetime NOT NULL, end_timestamp datetime NOT NULL, completion_timestamp datetime NULL, 
	time_spent real NOT NULL, complete bool NOT NULL, correct real NOT NULL, hinted bool NOT NULL, answer text NULL,
	 simple_answer varchar(200) NOT NULL, interaction_history text NOT NULL, dataset_id char(32) NOT NULL REFERENCES kolibriauth_facilitydataset (id), 
	 masterylog_id char(32) NULL REFERENCES logger_masterylog (id), 
	 sessionlog_id char(32) NOT NULL REFERENCES logger_contentsessionlog (id), user_id char(32) NULL REFERENCES kolibriauth_facilityuser (id));

CREATE TABLE logger_contentsessionlog (id char(32) NOT NULL PRIMARY KEY, _morango_dirty_bit bool NOT NULL, _morango_source_id varchar(96) NOT NULL, _morango_partition varchar(128) NOT NULL, content_id char(32) NOT NULL, channel_id char(32) NOT NULL, start_timestamp datetime NOT NULL, end_timestamp datetime NULL, time_spent real NOT NULL, progress real NOT NULL, kind varchar(200) NOT NULL, extra_fields text NOT NULL, dataset_id char(32) NOT NULL REFERENCES kolibriauth_facilitydataset (id), user_id char(32) NULL REFERENCES kolibriauth_facilityuser (id));

CREATE TABLE kolibriauth_facilitydataset (id char(32) NOT NULL PRIMARY KEY, _morango_dirty_bit bool NOT NULL, _morango_source_id varchar(96) NOT NULL, _morango_partition varchar(128) NOT NULL, description text NOT NULL, location varchar(200) NOT NULL, learner_can_edit_username bool NOT NULL, learner_can_edit_name bool NOT NULL, learner_can_edit_password bool NOT NULL, learner_can_sign_up bool NOT NULL, learner_can_delete_account bool NOT NULL);


